  [],\n\t\"num_tags\": 0,\n\t\"name\": \"ghrsst-level-2p-global-skin-sea-surface-temperature-from-the-infrared-atmospheric-sounding-intecc9e5\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A global 1 km Group for High Resolution
  Sea Surface Temperature (GHRSST) Level 2P dataset based on multi-channel sea surface
  temperature (SST) retrievals generated in real-time from the Infrared Atmospheric
  Sounding Interferometer (IASI) on the European Meteorological Operational-A (MetOp-A&#65289;satellite
  &#65288;launched 19 Oct 2006).nnThe European Organization for the Exploitation of
  Meteorological Satellites (EUMETSAT),nnOcean and Sea Ice Satellite Application Facility
  (OSI SAF) is producing SST products in near realnntime from METOP/IASI. The Infrared
  Atmospheric Sounding Interferometer (IASI) measures innnthe infrared part of the
  electromagnetic spectrum at a horizontal resolution of 12 km at nadir up tonn40km
  over a swath width of about 2,200 km. With 14 orbits in a sun-synchronous mid-morningnnorbit
  (9:30 Local Solar Time equator crossing, descending node) global observations can
  bennprovided twice a day. The SST retrieval is performed and provided by the IASI
  L2 processor atnnEUMETSAT headquarters. The product format is compliant with the
  GHRSST Data Specificationnn(GDS) version 2.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
